import React from "react";
export default function App()
{
    const [items, setItems] = React.useState([])

    function addItem()
    {
        setItems((prevItem) => {
            const arr = prevItem;
            arr.push(`Item ${arr.length() + 1}`)
        })
    }
    return(
        <div>
             <button onClick={addItem}> Add Item </button>
            <ul>
                {items.map((item) => <li>{item}</li>)}
            </ul>
        </div>
    );
}
